import PaperPlane from "../../../assets/images/paper-plane.jpg";

const Contact = () => {
    return (
        <main>
            <img className="contact__hero-banner" src={PaperPlane} alt="people throwing paper plane" />
        </main>
    );
};

export default Contact;
